import React from 'react';

function RecipientList({ recipientNames, removeRecipient }) {
    return (
        <div>
            <h2>Recipient List</h2>
            {recipientNames.map((name, index) => (
                <div key={index}>
                    <span>{name}</span>
                    <button onClick={() => removeRecipient(index)}>Remove</button>
                </div>
            ))}
        </div>
    );
}

export default RecipientList;
